import React, { useState } from "react";
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
  } from "reactstrap";
  import brazilianflag from '../images/brazilflag.png';
  import spanishflag from '../images/spanishflag.png';
  import usaflag from '../images/usaflag.png';

  const Topbar = props => {
    const [isOpen, setIsOpen] = useState(false);

    const toggle = () => setIsOpen(!isOpen);


    return (
      <div>
        <Navbar color="none" light expand="md">
          <NavbarBrand class="navbar-brand" href="#">
          <img src="../../public/newLogo.png" alt="" width="100" height="35"/>
          </NavbarBrand>
          <NavbarToggler onClick={toggle} />
          <Collapse isOpen={isOpen} navbar>
            <Nav className="justify-content-center" style={{ flex: 1}}>
              <NavItem > 
                <NavLink href="/components/" className='text-muted'>Features</NavLink>
                </NavItem>
                <NavItem>
                <NavLink href="/components/" className='text-muted'>Press</NavLink>
              </NavItem>



            </Nav>
            <div class="btn-group pull-right" role="group" aria-label="Basic example">
                <button type="button" class="btn"><img src={brazilianflag} height={6} width={20} /></button>
                <button type="button" class="btn"><img src={spanishflag} height={6} width={20} /></button>
                <button type="button" class="btn"><img src={usaflag} height={6} width={20} /></button>
            </div>
          </Collapse>
        </Navbar>
      </div>
    );
  };

  export default Topbar;
